INSERT INTO `tlps` VALUES (1,'contnt_html','<div id=\"content\"> \r\n\r\n<h1>Vista Self-Service Application</h1>           \r\n<h3><--- Use the menus! </h3>\r\n<div class=\"box\">\r\n<p><center><strong>Update your bookmarks!</strong> The Vista Self-Service Application has moved to this new address:<br/>\r\n<strong>http://dlt.csuchico.edu/vista</strong></center></p>\r\n</div>\r\n<p>Faculty and Staff can use this Self-Service Application to perform several important Vista course management tasks:</p>\r\n<ul>\r\n<li>Allow a guest designer in one of your sections.</li>\r\n<li>Enroll or remove members in a Vista community.</li>\r\n<li>Create a \"prep area\" section used for course development.</li>\r\n<li>Reset a section - erase all content and student data.</li>\r\n<li>Hide or show a section from everyone\'s course list; for instance an unused lab section.</li>\r\n<li>Get a participant list to use with TurningPoint clickers</li>\r\n</ul>\r\n<h2>Important Notes</h2>\r\n<h4>Managing Community Members</h4>\r\n<p>You must be the <strong>primary</strong> designer of a community to add/remove members.</p>\r\n<h4>Hiding Sections</h4>\r\n<p>You can only hide an unused Vista shell during the <strong>current term</strong>. University policy is that students retain access to past term sections for at least two years.</p>\r\n<h2>Getting Help</h2>\r\nIf you need assistance using this tool, contact the <a href=\"http://www.csuchico.edu/tlp\">Technology and Learning Program</a> at (530) 898-6167 or e-mail <a href=\"mailto:tlp@csuchico.edu\">tlp@csuchico.edu</a>. If you encounter an error or are attempting to perform a more advanced course management function, send an email to <a href=\"mailto:vista@csuchico.edu\">vista@csuchico.edu</a> to get assistance.\r\n</div>','2011-02-09 16:38:38','2011-02-09 16:38:38'),(2,'main_css','a {\r\n	color: #567799;\r\n	text-decoration: underline;\r\n}\r\na:hover, a:visited:hover {\r\n	color: #8b3003;\r\n}\r\na:visited {\r\n	color: #504d46;\r\n}\r\na img {\r\n	border: none;\r\n}\r\n\r\nbody {\r\n	font-family: Verdana, Arial, Helvetica, sans-serif;\r\n	\r\n}\r\n\r\ndiv #content {\r\ntext-align:left;\r\npadding: 10px 10px 30px 10px;\r\nfont-size:75%;\r\n}\r\n\r\n#content h1, \r\n#content h2, \r\n#content h3, \r\n#content h4, \r\n#content h5, \r\n#content h6 {\r\n	color: #960000;\r\n	font-family: Verdana, Arial, Helvetica, sans-serif;\r\n	font-weight: bold;\r\n}\r\n#content h1 {\r\n	font-size:1.9em;\r\n	line-height:1.25em;\r\n	margin:0 0 10px;\r\n	padding:0 0 10px;\r\n}\r\n#content h2 {\r\n	font-size:1.55em;\r\n	line-height:1.3em;\r\n	margin:0;\r\n	padding:12px 0 10px;\r\n}\r\n#content h3 {\r\n	font-size: 1.27em;\r\n	line-height: 1.3em;\r\n	margin: 0 0 0 0;\r\n	padding: 10px 0 10px 0;\r\n}\r\n#content h4 {\r\n	font-size: 1.09em;\r\n	line-height: 1.54em;\r\n	margin: 0 0 0 0;\r\n	padding: 8px 0 10px 0;\r\n}\r\n#content h5 {\r\n	font-size: 0.9em;\r\n	line-height: 1.37em;\r\n	margin: 0 0 0 0;\r\n	padding: 5px 0 0 0;\r\n}\r\n#content h6 {\r\n	font-size: 0.82em;\r\n	line-height: 1.18em;\r\n	margin: 0 0 0 0;\r\n	padding: 5px 0 0 0;\r\n}\r\n#content code {\r\n	font-family: \"Courier New\", Courier, monospace;\r\n}\r\n#content p {\r\n	font-size: 100%;\r\n	line-height: 15px;\r\n	margin: 0 0 0 0;\r\n	padding: 0 0 10px 0;\r\n}\r\n#content ul, \r\n#content ol, \r\n#content blockquote {\r\n	font-style: normal;\r\n	line-height: 1.5em;\r\n	font-weight: normal;\r\n}\r\n#content blockquote {\r\n	line-height: 1.5em;\r\n	font-size: 100%;\r\n	padding: 0.05em 2em .1em 2em;\r\n}\r\n#content .fineprint {\r\n	font-size: 80%;\r\n	font-style: normal;\r\n}\r\n#content img.img-left {\r\n	float: left;\r\n	padding: 6px 15px 10px 0px;\r\n}\r\n#content img.img-right {\r\n	float: right;\r\n	padding: 6px 0px 10px 15px;\r\n}\r\n#content .nofloat {\r\n        float:none !important;\r\n}\r\ndiv .box {\r\nmargin:0px 50px 10px 50px;\r\npadding: 5px 20px 5px 20px;\r\nbackground-color:#FAFFFA;\r\nborder:1px solid #DDD;\r\n}','2011-02-09 16:39:39','2011-02-09 16:39:39'),(3,'tasks_css','#task_box {\r\n    margin: 0 10px 0 0;\r\n    height: 636px;\r\n}\r\n\r\n#task_box ul#left_nav {\r\n    margin-top: -40px;\r\n    font-style: normal;\r\n    font-weight: normal;\r\n    line-height: 1.5em;\r\n    background-color: #E9E4D6;\r\n    background-image: url(\"../images/left-nav-bkg-template.jpg\");\r\n    background-position: left top;\r\n    background-repeat: repeat-x;\r\n    float: left;\r\n    list-style-type: none;\r\n    margin: 0 0 0 -10px;\r\n    min-height: 218px;\r\n    padding: 15px 0 20px;\r\n    width: 150px;\r\n    padding-left: 1.1em;\r\n    border: 0 none;\r\n    font-family: inherit;\r\n    vertical-align: baseline;\r\n}\r\n*:first-child + html #task_box ul#left_nav { /* hack for IE7 */\r\n    margin-left: 0px;\r\n}\r\n\r\n#task_box ul#left_nav li {\r\n    margin: 0 0 0 -17px;\r\n    padding: 0;\r\n    position: relative;\r\n    font-size: 70%;\r\n    font-weight: normal;\r\n    line-height: 15px;\r\n    vertical-align: baseline;\r\n    font-style: inherit;\r\n    border: 0 none;\r\n    font-family: inherit;\r\n    list-style-type: none;\r\n    color: #222222;\r\n}\r\n*:first-child + html #task_box ul#left_nav li { /* hack for IE7 */\r\n    margin-bottom: -5px;\r\n}\r\n\r\n#task_box ul#left_nav li ul {\r\n    display: none;\r\n    padding: 0 0 0 26px;\r\n}\r\n\r\n#task_box ul#left_nav li ul li {\r\n    width: 160px;\r\n	font-size: 100%;\r\n	background-color: #FFF6BF;\r\n}\r\n\r\n#task_box ul#left_nav li:hover {\r\n    background-color: #FFFFFF;\r\n}\r\n\r\n#task_box ul#left_nav li:hover ul {\r\n    display: block;\r\n    left: 150px;\r\n    margin: 0;\r\n    width: 20px;\r\n    position: absolute;\r\n    top: 0;\r\n}\r\n\r\n#task_box ul#left_nav li ul li:hover {\r\n    background-color: #FFF6E2;\r\n}\r\n\r\n#task_box ul#left_nav li a {\r\n    text-decoration: none;\r\n    display: block;\r\n    color: #000000;\r\n    display: block;\r\n    font-size: 95%;\r\n    padding: 6px 30px 7px;\r\n    text-decoration: non